def find_peak_regions(sites, readCounts, thresh=None):
    """ returns a list of tuples containing indices for regions occluded by NC
        ie these indices can be used to plot rectangles on plot showing regions to ignore
    """
    if len(sites) != len(readCounts):
        raise ValueError("number of sites does not match number of read count entries")
    if thresh == None: 
        thresh = np.mean(readCounts) + np.std(readCounts)
    
    above_regions = [] # regions where readcount is below threshold (meaning NC is bound)
    # NB region indices will be expressed lower inclusive, upper exclusive
    prev = -float("inf")
    curr = readCounts[0]
    
    state = None
    continue_below = 0
    continue_above = 1
    enter_below = 3
    enter_above = 4

    above_region = [None, None]
    for i in range(1, len(sites)):
        
        if prev < thresh and curr < thresh:
            #pass # dont need to do anything
            state = continue_below
        if prev >= thresh and curr >= thresh:
            #pass # dont need to do anything
            state = continue_above

        elif prev < thresh and curr >= thresh: # entering above_region
            above_region[0] = sites[i-1] 
            state = enter_below

        elif prev >= thresh and curr < thresh: # leaving above_region
            above_region[1] = sites[i-1] 
            above_regions.append( tuple(above_region) )
            state = enter_above

        prev = curr
        curr = readCounts[i]
    
    if state == continue_above:
        # as the loop ended, the region was below the threshold and above_region had not been updated with second index. We therefore add the final below-region 
        above_region[1] = len(sites) - 1 # nb not using slice indieces here, should we be?
        above_regions.append(above_region)

    return above_regions


def plot_nc_binding():
    mean = np.mean(mature)
    std = np.std(mature)
    plt.plot(sites,mature)
    plt.plot( sites, [mean]*len(sites) )
    plt.plot( sites, [mean+std]*len(sites) )
    plt.xticks(range(0, 10000, 1000))
    plt.show()


