def count_gap(sequences, iSite, gap="-"):
    n = 0
    for pair in sequences:
        seq = pair[1]
        if seq[iSite] == gap: n += 1
    
    return n


# admin function
def check_aln_df_names_match(df, sequences):
    df_seq_id = sorted(df.drop_duplicates(["seq_id"])["seq_id"].unique())
    aln_seq = sorted([ pair[0] for pair in sequences ])
    if len(df_seq_id) != len(aln_seq):
        raise ValueError("Number of unique sequence identifiers in table (%d) != number of sequences in alignment (%d)" % (len(df_seq_id), len(aln_seq)))

    for i in range(len(aln_seq)):
        if df_seq_id[i] != aln_seq[i]:
            raise ValueError("Mismatch between sequence in aln and input table")

# admin function
def make_aln_name_seq_id(sequences):
    # assuming names in alignment in format <group>.<seq_id>
    # make names seq_id only
    sequences_new = []
    for i in range(len(sequences)):
        name = sequences[i][0]
        seq_id = name.split(".")[1]
        sequences_new.append( [seq_id, sequences[i][1]])
    return sequences_new

